import React from 'react'

export default function Appbar() {
  return (
    <div>
      <AppBar position="static">
            <Box
              sx={{
                background: "#eadbce",
                display: { xs: "none", md: "flex" },
                justifyContent: "flex",
              }}
            >
              <Toolbar>
                <Link href="/">
                  <Box
                    component="img"
                    sx={{ height: 75, justifyContent: "flex-start" }}
                    alt="Logo"
                    src={logo}
                  />
                </Link>
              </Toolbar>

              {pages.map((page) => (
                <Button
                  key={page}
                  onClick={handleCloseNavMenu}
                  sx={{ my: 2, color: "black", display: "block" }}
                >
                  {page}
                </Button>
              ))}
            </Box>
          </AppBar>
    </div>
  )
}
